import React from 'react';
// import logo from './logo.svg';
import './App.css';
import ChoiceCard from './components/ChoiceCard'
import List from './components/List'

const choices = {
  rock: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fsteamcommunity.com%2Fsharedfiles%2Ffiledetails%2F%3Fid%3D431014972&psig=AOvVaw0FbbsBf_8JXWt8BHBy0YSn&ust=1590474568876000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCOCn7dKxzukCFQAAAAAdAAAAABAK",
  paper: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.123rf.com%2Fphoto_109662873_stock-illustration-cute-and-sweet-love-note-illustration-isolated-on-a-white-background.html&psig=AOvVaw2-h3_jHzy3k3idl2UI6KtO&ust=1590474708027000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJCnopOyzukCFQAAAAAdAAAAABAD",
  scissors:"https://www.google.com/url?sa=i&url=https%3A%2F%2Fdlpng.com%2Fpng%2F6934356&psig=AOvVaw2EYDr6UYn8OcWywAkC5imf&ust=1590474746232000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKjbpbWyzukCFQAAAAAdAAAAABAD"
};



function App() {
    return ( 
      <div className="App">
         <ChoiceCard title = "You" winner = {false} imgURL = {choices.rock} />
         <ChoiceCard title = "Computer" winner = {true} imgURL = {choices.paper} />
      </div>
    );
}

export default App;
